function Navbar(){

    return (

    <nav className="sideBarMenu">
        <div className="menuItem"><a href="/"><i className="fa-solid fa-home"></i></a></div>
        <div className="menuItem"><a href="/formateurs"><i className="fa-solid  fa-chalkboard-teacher"></i></a></div>
        <div className="menuItem"><a href="/filieres"><i className="fa-solid fa-school"></i></a></div>
        <div className="menuItem"><a href="/groupes"><i className="fa-solid fa-clock"></i></a></div>
        <div className="menuItem"><a href="/modules"><i className="fa-solid fa-book"></i></a></div>
        <div className="menuItem"><a href="/salles"><i className="fa-solid fa-door-closed"></i></a></div>
        <div className="menuItem"><a href="/sallesDispo"><i className="fa-solid fa-door-open"></i></a></div>
        <div className="menuItem"><a href="/cours"><i className="fa-solid fa-calendar-check"></i></a></div>
        <div className="menuItem"><a href="/emploiParDate"><i className="fa-solid fa-calendar"></i></a></div>
    </nav>


    )
}
export default Navbar;
